import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./nav.scss";
import logo from "../../images/logo_umatech.svg";
import ToggleMenu from "../ToggleMenu/ToggleMenu.jsx";

const Nav = ({ list, isMobile }) => {
  if (!isMobile) {
    return (
      <nav className='menu'>
      <div className='container'>

          <ul className='menu-ul menu__menu-ul'>
              {list.map((li, index) => (
                  <li key={index} className='menu-ul__li'>
                      {li.title}
                  </li>
              ))}
              <Link to='products' className='menu-ul__li'>Статьи</Link>
          </ul>

      </div>
  </nav>
  );
};
};
export default Nav;
